script:
const size = { x: 16, y: 8, z: 32 };
const origin = { x: 0, y: 0, z: -16 };

reset();

box(
  origin.x, origin.y, origin.z,
  size.x, size.y, size.z,
  1
);
box(
  origin.x, origin.y-3, origin.z,
  size.x, size.y, size.z,
  3
);
box(
  origin.x + 1, origin.y + size.y - 2, origin.z + 1,
  size.x - 2, 2, size.z - 2,
  0
);
box(
  origin.x + 2, origin.y + size.y - 2, origin.z,
  4, 2, 1,
  0
);
box(
  origin.x + 10, origin.y + size.y - 2, origin.z,
  4, 2, 1,
  0
);

const elevator = {
  x: origin.x + 4,
  y: 6,
  z: origin.z + size.z - 8,
};

box(
  elevator.x, elevator.y, elevator.z,
  8, 7, 8,
  1
);
box(
  elevator.x + 1, elevator.y - 1, elevator.z + 1,
  6, 7, 6,
  2
);
box(
  elevator.x + 2, elevator.y, elevator.z + 2,
  4, 5, 4,
  0
);
box(
  elevator.x + 2, elevator.y, elevator.z - 1,
  4, 5, 1,
  1
);
box(
  elevator.x + 3, elevator.y, elevator.z - 1,
  2, 4, 3,
  0
);
